import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <div>
    <h1>Список покупок</h1>
    <ul>
      <li>Хлеб</li>
      <li>Масло</li>
      <li>Колбаса</li>
    </ul>
  </div>
);


